# @lc code=start
from typing import List

class TowerSpace:
    def __init__(self, begin, end) -> None:
        self.begin = begin
        self.end = end
        self.height = 0
    def __repr__(self) -> str:
        return '{}->{}^{}'.format(self.begin, self.end, self.height)

class Overlap:
    def __init__(self) -> None:
        self.sticking_left = None
        self.covered = []
        self.sticking_right = None
        self.sticking_both_sides = None

    def none(self) -> bool:
        return self.sticking_left is None \
            and self.sticking_right is None \
            and len(self.covered) == 0

    def validate(self) -> bool:
        assert self.sticking_both_sides is None \
            or (self.sticking_left is None \
                and self.sticking_right is None \
                    and len(self.covered) == 0)
        if len(self.covered) > 0:
            prev_idx = self.covered[0]
            for i in range(1, len(self.covered)):
                if self.covered[i] - prev_idx != 1:
                    assert False
                prev_idx = self.covered[i]

class Solution:
    def fallingSquares(self, positions: List[List[int]]) -> List[int]:
        results = []
        max_height = 0
        towers = [TowerSpace(0, 101000001)]
        print(towers)
        for x0, w in positions:
            new_tower = TowerSpace(x0, x0 + w)
            ot = self.overlapping_towers(towers, new_tower)
            stop_height = 0
            if ot.sticking_both_sides is not None:
                stop_height = towers[ot.sticking_both_sides].height
                right_tower = TowerSpace(new_tower.end, towers[ot.sticking_both_sides].end)
                right_tower.height = towers[ot.sticking_both_sides].height
                towers.insert(ot.sticking_both_sides + 1, right_tower)
                towers.insert(ot.sticking_both_sides + 1, new_tower)
                towers[ot.sticking_both_sides].end = new_tower.begin
            else:
                insert_index = None
                if ot.sticking_left is not None:
                    stop_height = max(stop_height, towers[ot.sticking_left].height)
                    towers[ot.sticking_left].end = new_tower.begin
                    insert_index = ot.sticking_left + 1
                if ot.sticking_right is not None:
                    stop_height = max(stop_height, towers[ot.sticking_right].height)
                    towers[ot.sticking_right].begin = new_tower.end
                    if insert_index is None:
                        insert_index = ot.sticking_right
                if len(ot.covered) > 0:
                    first_overlap = ot.covered[0]
                    if insert_index is None:
                        insert_index = first_overlap
                    else:
                        insert_index = min(insert_index, first_overlap)
                    for i in range(len(ot.covered)):
                        stop_height = max(stop_height, towers[first_overlap].height)
                        towers.pop(first_overlap)
                towers.insert(insert_index, new_tower)

            new_tower.height = stop_height + w
            max_height = max(max_height, new_tower.height)
            results.append(max_height)
            # print(towers)
        return results

    def overlapping_towers(self, towers: List[TowerSpace], new_tower) -> Overlap:
        ot = Overlap()
        for i in range(len(towers)):
            t = towers[i]
            if t.begin >= new_tower.end:
                break

            begin = max(t.begin, new_tower.begin)
            end = min(t.end, new_tower.end)

            if begin >= end:
                continue

            if t.begin < new_tower.begin:
                if t.end > new_tower.end:
                    ot.sticking_both_sides = i
                else:
                    ot.sticking_left = i
            else:
                if t.end > new_tower.end:
                    ot.sticking_right = i
                else:
                    ot.covered.append(i)

        ot.validate()
        return ot

